import React from "react";
import loaders from "../../../image/loader.png";
import Loader from "react-js-loader";

let Preloader = (props) => {
  return (
    <>
      {" "}
      <div className={"item"}>
        <Loader
          type="bubble-scale"
          bgColor={"#FFFFFF"}
          title={"bubble-scale"}
          size={100}
        />
      </div>
      <img src={loaders} style={{ position: "absolute", top: "-100px" }} />
    </>
  );
};

export default Preloader;
